import React from 'react'

function Table() {
  return (
    <div classNameName='bg-blue-400' >      
        <div className="overflow-x-auto relative shadow-md sm:rounded-lg">
           <div className="flex justify-center content-center"></div>
        </div>
    </div>
  )
}

export default Table
